import React from "react";

import Home from "./Home";
import { BrowserRouter, Route, Routes } from "react-router-dom";


function App() {


  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>


  return (


    <Route  exact path="/" component={props => <Home />} />


  );
}

export default App;
